e's Emerald Jewel now takes 2 seconds instead of 1.5 seconds before spinning up and charging. - Done ✅ \n414 - Increased King Slime's Ruby, Sapphire, and Emerald Jewel hitbox sizes. - Done ✅ \n415 - Reworked the Slime God fight visually (resprited the Paladins, the Core, added new jumping and landing squash and stretch effects, etc.), and changed the behavior of the unsplit Ebonian and Crimulan Paladins.\n416 - Adjusted the Profaned Guardian Defender and Commander charge attacks so that they don't keep trying to charge directly into you once they get close enough. - Done ✅ \n417 - Fixed Rev+ Destroyer not having a netMode check for its segment spawning. - Done ✅ \n418 - Fixed Retinazer projectile firing offsets and rotation rate (it wasn't firing lasers from the exact position I wanted it to and it wasn't rotating fast enough, which led to really awkward-looking movements at times). - Done ✅",
