en defeated in Boss Rush. - Done ✅ \n157 - Fixed Sniper Scope critical strike chance nerf so that it's actually reducing critical strike chance by 3%. - Done ✅ \n158 - Made Boss HP config compatible with other mods. - Done ✅ \n159 - Resprited all Calamity Dye bottle caps to make them consistent in terms of colors. - Done ✅ \n160 - Fixed some issues with the Exo Chest tile sprite. - Done ✅ \n161 - Added a status nag message for VCMM now that it is official. **This can be disabled with a config option.** - Done ✅ \n162 - Slightly improved the mod description and Steam Workshop mod description. - Done ✅ \n163 - Occult Skull Crown recipe now requires 3 Twisting Nether instead of 20 Nightmare Fuel. - Done ✅ \n164 - Cataclysm and Catastrophe now drop their special drops depending on which one is killed last. - Done ✅ \n165 - Cataclysm and Catastrophe bestiary entries now explain how to get their special drops. - Done ✅",
