                "content": "106 - Ascendant Insignia cooldown now resets after death. - Done ✅ \n107 - Added half second projectile telegraphs for Spider enemies and Ichor Stickers. - Done ✅ \n108 - Botanic Piercer projectiles now go through tiles again. - Done ✅ \n109 - Fixed janky movement for Hovering AI enemies in Rev+. - Done ✅ \n110 - Added half second projectile telegraphs for Antlions and Rev+ Blazing Wheels. - Done ✅ \n111 - Consumable upgrades are now only consumed if their upgrade actually applies. - Done ✅ \n112 - Astrum Aureus and Hive Mind now only increment their attack timers faster while being hit in Master+ only. - Done ✅ \n113 - Decreased Master Rev+ Detonating Bubble velocity. - Done ✅ \n114 - Decreased Rev+ Skeletron Prime skull projectile homing duration by half a second. - Done ✅ \n115 - Added half second projectile telegraphs for Harpies, Demons, Voodoo Demons, and Red Devils. - Done ✅ \n116 - Decreased Bone Lee movement and attack velocities on all modes. - Done ✅ \n117 - Added half second projectile telegraphs for Spike Slimes, Spiked Jungle Slimes, and Spiked Ice Slimes. - Done ✅ \n118 - Auric Ore sound now plays on top of players. - Done ✅ \n119 - Fixed Supreme Calamitas' brimstone darts having a slightly larger hitbox than intended. - Done ✅ \n120 - Vortex Larvae and Hornets now have hard limits on how much they can evolve (only 6 Hornets can be alive at one time and only 3 Queens can be alive at one time). - Done ✅ \n121 - Changed Omniscience Potion projectile visibility to be better. - Done ✅ \n122 - Added Nimble Bounder. - Done ✅ \n123 - Added gores for Astrum Aureus. - Done ✅ \n124 - Added gores for Astrum Deus. - Done ✅ \n125 - Made Astrum Deus not fire projectiles during the phase 2 transition. - Done ✅ \n126 - Fixed Nebula Floater nebula lasers being faster than intended rather than slower (they were always meant to be nerfed, but somewhere along the line a minus sign was turned into a plus sign). - Done ✅ \n127 - Added half second projectile telegraph for Ice Elementals. - Done ✅ \n128 - Made Ancient Altar and Basin require Demonic Bone Ash to craft instead of Infernal Suevite. - Done ✅ \n129 - Made Ashen Altar and Basin require Demonic Bone Ash to craft instead of Unholy Cores. - Done ✅ \n130 - Ashen Accent Slab no longer requires Unholy Cores to craft. - Done ✅ \n131 - Ashen Slab and Ashen Accent Slab now require 100 pickaxe power to mine instead of 180 and take less time to mine. - Done ✅ \n132 - Made Demonic Bone Ash recipe costs consistent for Ancient and Ashen Altars and Basins (they cost 5 to craft). - Done ✅",
