                "type": 0,
                "content": "45 - Fixed Artemis and Apollo telegraphs not drawing. - Done ✅ \n46 - Fixed an issue with Miracle Matter's offset. - Done ✅ \n47 - Added new player targeting for Queen Bee. - Done ✅ \n48 - Added new player targeting for Skeletron and his hands. - Done ✅ \n49 - Added new player targeting for Queen Slime. - Done ✅ \n50 - Added new player targeting for Wall of Flesh. - Done ✅ \n51 - Fixed Ancient Chisel and Hand of Creation mining speed nerf applying after the mining speed cap. - Done ✅ \n52 - Fixed Ocean Crest mining speed applying after the mining speed cap. - Done ✅ \n53 - Updated Mining Potion and Hand of Creation tooltips. - Done ✅ \n54 - Renamed Dragonfruit to Sacred Strawberry. - Done ✅ \n55 - Changed many late-game weapons to inflict proper debuffs. - Done ✅ \n56 - Increased Astrum Deus' velocity for 4 seconds after he spawns. - Done ✅ \n57 - Respiteblock's blood no longer pierces infinitely. - Done ✅ \n58 - Spectral Veil now applies 6 seconds of Chaos State while no bosses are alive. - Done ✅ \n59 - Fixed a Rev+ Brain of Cthulhu clone drawing opacity issue. - Done ✅ \n**60 - Fixed a memory leak in the universal tile merging system.** There is still another major memory leak with this system and we're looking into how to remedy it. - Done ✅ \n61 - Fixed Security Chest sheeting issue. - Done ✅ \n62 - Decreased the velocity of Rev+ Golem's attached head fireball projectiles and made the Body's fireballs have an even spread. - Done ✅ \n63 - Added Smart Cursor and Echo Coating support for Calamity Music Boxes. - Done ✅ \n64 - Fixed Ancient Treasure Chest outline issue. - Done ✅ \n65 - Added a Faster Rope Climb Speed Calamity Config option. - Done ✅ \n66 - Fixed an issue with LightHitWire in multiplayer. - Done ✅ \n67 - Fixed Music Box wiring NetMessage not being passed. - Done ✅ \n68 - Resprited the Title Music Box. - Done ✅ \n69 - Changed the Laserfish bestiary entry. - Done ✅ \n70 - Added Melee-ranged support for the Colored Damage Typ