                "type": 0,
                "content": "**V2.1.0.001 (not released):**\n\n1 - Fixed Spiteful Candle tooltip having incorrect damage values. - Done ✅ \n2 - Fixed Holy Fire Bullet explosion immunity frames. - Done ✅ \n3 - Halved Cnidrion spawn rate. - Done ✅ \n4 - Adjusted the sell values and buy prices of nearly all of Cirrus' items. - Done ✅ \n5 - Decreased Master+ Hive Mind Vile Spit velocity. - Done ✅ \n6 - Decreased Expert+ Hive Mind Vile Spit fire rate while drifting. - Done ✅ \n7 - Fixed several Banshee Hook projectile problems. - Done ✅ \n8 - Gave Arietes 41, Pearl God, and Kingsbane better firing sounds. - Done ✅ \n9 - Moved point-blank shot and charge tooltips above reforge stats so they look less out of place. - Done ✅ \n10 - Eutrophic Crates now drop Driftwood. - Done ✅ \n11 - Reworked Fetid Emesis. - Done ✅ \n12 - Gave Normality Relocator new teleport sounds. - Done ✅ \n13 - Gave Brimstone Elemental and Brimlings new sounds. - Done ✅ \n14 - Reworked Butcher and renamed it to Buzzkill. - Done ✅ \n15 - Reworked Elemental Blaster and renamed it to Superradiant Slaughterer. - Done ✅ \n16 - Fixed a bug with the Flight Time Bar. - Done ✅ \n17 - Added Marnite furniture. - Done ✅ \n18 - Added Static Discharge, Vermilion Flux, and Auric Rebuke debuffs. - Done ✅ \n19 - Added Auric Land Mine <a:trollge:828495602316476466> . - Done ✅ \n20 - Bloodstone Core-crafted weapons now inflict Laceration. - Done ✅ \n21 - Fixed Craw Carapace line thorns damage hitting invincible enemies. - Done ✅ \n22 - Added new player targeting for King Slime and his Jewels. - Done ✅ \n23 - King Slime's Ruby Jewel now floats a bit lower because it was annoying to hit. - Done ✅ \n24 - Adjusted how timed DR is calculated for Eater of Worlds, Destroyer, and Astrum Deus, in order to make the DR remain high if the segments haven't started moving yet, and made the DR not scale down as quickly over its duration. - Done ✅ \n25 - Made the first charge Yharon does after a bullet hell attack slower, made him take longer to charge after a bullet hell, and decreased his drift speed after a bullet hell (these changes don't apply in Master). - Done ✅ \n26 - Mechanic Shed now starts looking for a Y coordinate closer to the world surface to avoid spawning on floating islands. - Done ✅ \n27 - Empress of Light now returns to her target immediately after she's done charging, allowing players to hit her while she's paused after her charge. - Done ✅ \n28 - Gave Calamitas Clone new sounds. - Done ✅ \n29 - Resprited Infected Jewel. - Done ✅ \n30 - Hive Mind is now immune to Brain Rot. - Done ✅ \n31 - Perforator Hive and Perforators are now immune to Burning Blood. - Done ✅ \n32 - Reworked Death Valley Duster. - Done ✅ \n33 - Reworked Primordial Earth. - Done ✅ \n34 - Reworked Primordial Ancient. - Done ✅ \n35 - Respiteblock's chainsaw now inflicts Laceration instead of Burning Blood. - Done ✅ \n36 - Added new player targeting for Eater of Worlds. - Done ✅ \n37 - Added new player targeting for Brain of Cthulhu and its Creepers. - Done ✅ \n38 - Added new player targeting for Eye of Cthulhu. - Done ✅ \n39 - Renamed Blood Orange to Sanguine Tangerine. - Done ✅ \n40 - Renamed Elderberry to Tainted Cloudberry. - Done ✅ \n41 - Renamed Rune of Kos to Mark of Providence. - Done ✅ \n42 - Renamed Hive to Astraglomerate. - Done ✅ \n43 - Renamed Hiveling to Glomerling. - Done ✅ \n44 - Renamed Elemental Quiver to Planebreaker's Pouch. - Done ✅",
