            {
                "type": 0,
                "content": "48 - Reduced Purple Candle's defense effectiveness boost from 15% to 10%. - Done ✅ \n49 - Updated many boss targeting behaviors to improve them in multiplayer and fix some singleplayer bugs. - Done ✅ \n50 - Fixed non-Rev Wall of Flesh Eyes not firing lasers. - Done ✅ \n51 - Increased Ruby Jewel projectile spread in Death+ to make dodging between the shots easier, and reduced the number of projectiles per spread in Death from 5 to 4 (it's still 5 in Master). - Done ✅ \n52 - Sapphire Jewel now stays above King Slime and teleports with him. - Done ✅ \n53 - Master Rev+ King Slime now spawns Emerald Jewel at 70%, Ruby Jewel at 50%, and Sapphire Jewel at 30%. - Done ✅ \n54 - Fixed Duke Fishron's map icon in Master Mode (it wasn't disappearing at the right HP percentages). - Done ✅ \n55 - Decreased King Slime Jewel HP values by about 15%. - Done ✅ \n56 - Made Desert Nuisances have more clear movement differences. - Done ✅ \n57 - Increased Desert Scourge fall velocity if it's above the player. - Done ✅ \n58 - Fixed Brimstone Elemental's Brimstone Ray split shots dealing full Ray damage. - Done ✅ \n59 - Rev+ Eye of Cthulhu can no longer do its horizontal charge unless it is within a 10 block radius of its charge position, it also increases its velocity to move to that position if it's taking too long to reach it (this is to prevent cheap hits). - Done ✅ \n60 - Reduced Blood Nautilus Shot projectile blood trail distance by 50% (it looked really silly on Rev+ EoC, BoC, and even Dreadnautilus itself). - Done ✅ \n61 - Made Bloodletting Servants a bit lighter in terms of their base draw color and their charge telegraph (makes them easier to see). - Done ✅ \n62 - Fixed a Rev+ Eye of Cthulhu Blood Shot damage issue for its phase 2 spreads. - Done ✅ \n63 - Adjusted Brain of Cthulhu Creeper aggression scaling to take enrage into account, this makes them far less aggressive while in the underground crimson. - Done ✅ \n64 - Improved Rev+ Skeletron's moving away before charging, it's slower and smoother now. - Done ✅ \n65 - Decreased Rev+ Skeletron Hand HP by about 15%. - Done ✅ \n66 - Fixed Rev+ King Slime teleport out of bounds errors. - Done ✅ \n67 - Gave Queen Bee a distinct noise for her bee spawning. - Done ✅ \n68 - Made Hive Mind Dark Hearts more dangerous by making them drift back and forth above the player. - Done ✅ \n69 - Gave Hive Mind some Master Mode changes (not finished yet). - Done ✅ \n70 - Hive Mind uses an attack sooner in phase 2 if the player is close to it or if it's taking damage. - Done ✅ \n71 - Hive Mind Hive Blobs now fade out and teleport with Hive Mind. - Done ✅ \n72 - Hive Mind Hive Blobs no longer spawn in phase 2. - Done ✅ \n73 - Ceaseless Void Dark Energies no longer inflict Distorted and Ceaseless Void now inflicts Distorted on contact. - Done ✅ \n74 - Adjusted Ceaseless Void movements while it's not sucking to make it more predictable. - Done ✅ \n75 - Dank Creepers now attempt to fly above the player and kill themselves while at low HP in order to spawn their rain cloud in a more logical location. - Done ✅ \n76 - Increased Dank Creeper HP by about 33%. - Done ✅ \n77 - Decreased Brain Rot debuff duration from Hive Mind clouds and rain from 6 seconds to 4 seconds and 2 seconds respectively. - Done ✅ \n78 - Dank Creepers now inflict Brain Rot for 3 seconds when inflicting contact damage. - Done ✅ \n79 - Hive Mind now inflicts Brain Rot for 5 seconds when inflicting contact damage. - Done ✅ \n80 - Hive Mind Hive Blobs now always target Hive Mind's target. - Done ✅ \n81 - Astrum Aureus now walks for less time if his target is nearby and stays idle for less time if his target is nearby or hitting him. - Done ✅ \n82 - Brimstone Elemental now floats around for less time if her target is nearby or hitting her and teleports faster in higher difficulties. - Done ✅ \n83 - Crabulon now walks for less time if his target is nearby and stays idle for less time if his target is nearby or hitting him. - Done ✅",
