                "type": 0,
                "content": "**V2.0.4.003:**\n\n1 - Fixed Magna Cannon and Opal Striker dealing no damage. - Done ✅\n2 - Additional multiplayer desync fixes for Harvest Staff. - Done ✅\n3 - Increased Ink Bomb's drop rate from Cuttlefish and Colossal Squids. - Done ✅\n4 - Decreased Resilient Candle's defense effectiveness boost from 15% to 10%. - Done ✅\n5 - Decreased Weightless Candle's movement speed and flight time boosts from 10% to 5%. - Done ✅\n6 - Ash Wood Sword is now part of the Any Wooden Sword recipe group. - Done ✅\n7 - Reduced the defense boosts from several accessories (mostly shields). - Done ✅\n8 - Fixed the Slime God core killing itself when attempting to despawn. - Done ✅\n9 - Added a new sound for the Chaos State cooldown expiring. - Done ✅\n10 - Resprited the icons in the Bestiary's debuff vulnerability and resistance section to make their colors more unique. - Done ✅\n11 - Resprited Aerialite Dye, Clock Gatlignum, and Astrum Deus Relic. - Done ✅\n12 - Fixed Bloodfire Arrows not removing health while on lifesteal cooldown. - Done ✅\n13 - Profaned Guardians no longer enrage outside of the Hallow or Underworld, and now enrage at night instead of despawning. - Done ✅\n14 - Vanilla boss health bar now shows the combined health of all three Profaned Guardians. - Done ✅\n15 - Fixed Providence always being enraged in Remix seed. - Done ✅\n16 - Fixed Deerclops' ice spikes not dealing damage in Revengeance Mode. - Done ✅\n17 - Fixed certain Abyss and Sunken Sea ambient tiles being destroyed by water. - Done ✅\n18 - Reinforced Crates can now be placed on top of each other. - Done ✅\n19 - Fixed Desert Scourge shitting sand blasts on every frame during the burrow attack in certain scenarios. - Done ✅\n20 - Enchanted Starfish can now be shimmered into Arcane Crystal. - Done ✅\n21 - Hailstorm Bullets now inflict Frostbite, and flash freeze now inflicts Glacial State if the target is not a boss. - Done ✅\n22 - Fixed Hailstorm Bullet's flash freeze damage double scaling. - Done ✅\n23 - Fixed Icicle Arrows getting launched at high speeds if they rise into tiles. - Done ✅\n24 - Removed all of the random old anti-cheese shit from Weak Petrification; it now only reduces flight time and disables double jumps. - Done ✅\n25 - Boss Rush no longer disables wiring. - Done ✅\n26 - Fixed issues with Yharon's border firewall shader. - Done ✅\n27 - Added tooltips clarifying life regeneration boosts to a ton of items that were missing them. - Done ✅\n28 - Alchemical Flask no longer grants immunity to Plague; it now reduces the damage over time by 66%. - Done ✅\n29 - Alchemical Flask now grants the Honey buff and spawns plague seekers when hurt. - Done ✅\n30 - Added The Cauldron. - Done ✅\n31 - Added Respiteblock. - Done ✅\n32 - Prideful Hunter's Planar Ripper now has visual effects for its movement speed boost. - Done ✅\n33 - Fixed the Bandit and Drunk Princess not turning rainbow while under the effects of Odd Mushroom. - Done ✅\n34 - Ice Golem no longer inflicts Glacial State. - Done ✅\n35 - Cryogen's ice bombs and Lunatic Cultist's ice mists no longer freeze the player if they're already frozen. - Done ✅\n36 - Statis' Blessing and its upgrades no longer make minions inflict Holy Flames. - Done ✅\n37 - Fixed Broken Water Filter not working properly. - Done ✅\n38 - Reworked Toxic Heart. - Done ✅\n39 - Removed Plague Hive. - Done ✅\n40 - Warmth Potion no longer grants immunity to Chilled, Frozen, and Glacial State; it now makes those debuffs last a third of their normal durations. - Done ✅\n41 - Prismatic Breaker now properly uses a combination of melee and ranged damage instead of using a weird hacky formula to combine them. - Done ✅\n42 - Improved Shredder and Infinity. - Done ✅\n43 - Reworked Svantechnical, and it now uses Infinity in its recipe instead of SDFMG. - Done ✅\n44 - The player now gains a 5 second global cooldown to immobilizing debuffs after being inflicted by one. - Done ✅",
