                "content": "41 - Made Master Rev+ Twins and Destroyer leave the Master Rev+ Skeletron Prime fight at 75% HP instead of 70% HP. - Done ✅ \n42 - Master Rev+ Destroyer turns slower while offscreen during the Master Rev+ Skeletron Prime fight. - Done ✅ \n43 - Master Rev+ Twins no longer enter phase 2 during the Master Rev+ Skeletron Prime fight. - Done ✅ \n44 - Chronomancer's Scythe is now magic instead of melee. - Done ✅ \n45 - Fixed money laundering exploits with several items. - Done ✅ \n46 - Fixed Abyss Layer 1 water color. - Done ✅ \n47 - Fixed Sahara Slicers and Death's Ascension not getting Legendary. - Done ✅ \n48 - Moved Nitro Express Rifle to post-Wall of Flesh. - Done ✅ \n49 - Changed the minimum Adrenaline loss upon taking damage from 10% to 25%. - Done ✅ \n50 - Fixed some bugs and telefrag issues with the Supreme Calamitas fight. - Done ✅ \n51 - Made some changes to Supreme Cataclysm and Supreme Catastrophe in Master Mode and GFB. - Done ✅ \n52 - Made Flame Waker Boots require Hellstone Bars. - Done ✅ \n53 - Made Hellfire Treads require Essences of Havoc. - Done ✅ \n54 - Hellfire Treads no longer stack with downgrades. - Done ✅ \n55 - Plantera's projectiles now adjust their firing positions if the player is close enough. - Done ✅ \n56 - Fixed Holy Fire Bullet explosions not being able to hit the same enemy. - Done ✅ \n57 - Fixed the Stealth Meter having a delay between appearing full and being full. - Done ✅ \n58 - Fixed Rev+ Deerclops Ice Spike projectile hitboxes. - Done ✅ \n59 - Fixed first-time Boss Rush end dialogue not showing. - Done ✅ \n60 - Decreased Boss Rush Tier 4 and 5 delay between bosses from 6 seconds to 4 seconds. - Done ✅ \n61 - Decreased all Boss Rush dialogue delay by 0.5 seconds. - Done ✅",
