                "type": 0,
                "content": "**V2.0.4.002:**\n\n1 - Depth Crusher is now dropped by Viperfish instead of Moray Eels. - Done ✅ \n2 - Cleansing Jelly and its upgrades' auras no longer remove defense damage. - Done ✅ \n3 - Changed Chronomancer's Scythe's damage type from melee to magic. - Done ✅ \n4 - Fixed Elemental Lance splitting 30 times... - Done ✅ \n5 - Slick Cane is now sold by the Bandit immediately instead of in Hardmode and its stealth strike damage now scales with the amount of coins the player is carrying. - Done ✅ \n6 - Rocket I and Rocket II can now be crafted at Iron and Lead Anvils. - Done ✅ \n7 - Spawn blockers are now toggled by right clicking them instead of favoriting them. - Done ✅ \n8 - Calamity's blood particles now turn rainbow colored if the blood and gore setting is turned off. - Done ✅ \n9 - Sunken Sea walls now appear on the minimap. - Done ✅ \n10 - Fixed Chalice of the Blood God disabling dodges even for large hits. - Done ✅ \n11 - Fixed Cinder Arrows splitting infinitely in multiplayer. - Done ✅ \n12 - Fixed Deerclops jumping into space in Rev+. - Done ✅ \n13 - Fixed Eater of Worlds taking only 1 damage outside of Revengeance Mode. - Done ✅ \n14 - Fixed Giant Clam's defense not lowering. - Done ✅ \n15 - Fixed holdout projectiles breaking when interacting with UI. - Done ✅ \n16 - Fixed Revengeance Master Mode Skeletron Prime causing players to fuse together in multiplayer. - Done ✅ \n17 - Fixed the Stealth Meter visually appearing as full before it actually becomes full. - Done ✅ \n18 - Fixed Destroyer having 250 HP and exploding instantly when hit in multiplayer. - Done ✅ \n19 - Fixed Desert Scourge and Nuisances not having body segments in multiplayer. - Done ✅ \n20 - Fixed Eidolon Wyrm and several other worm enemies despawning instantly when their target teleports far away. - Done ✅ \n21 - Fixed some unintended inconsistencies with boss contact damage. - Done ✅ \n22 - Fixed Mythril Halberd causing enemies with 0 contact damage to deal contact damage for 1 frame. - Done ✅ \n23 - Fixed Hive Mind phase 2 sprite being completely screwed in multiplayer. - Done ✅ \n24 - Fixed Ebonian and Crimulan Paladins not despawning properly. - Done ✅ \n25 - Fixed some issues with Devourer of Gods movement and player targeting. - Done ✅ \n26 - Decreased Desert Scourge and Nuisance turn speeds on all difficulties by approximately 15%. - Done ✅ \n27 - Fixed various tooltip inconsistencies. - Done ✅ \n28 - Fixed an issue with various homing projectiles targeting the incorrect enemy when they were supposed to be targeting the closest enemy (this happened frequently with worms, where these projectiles would almost always target the tail). - Done ✅ \n29 - Increased the damage dealt by various bosses and their projectiles in Master Mode (yes, I did the math, and factored in defense and DR). - Done ✅ \n30 - Fixed Master Mode Desert Scourge's map icon vanishing after it spawns the Nuisances. - Done ✅ \n31 - Improved Scourge of the Desert's homing. - Done ✅ \n32 - Fixed Rev+ Skeletron losing all velocity sometimes after he teleports during a charge attack. - Done ✅ \n33 - Increased how long Rev+ Skeletron remains in floating phase while his hands are alive. - Done ✅ \n34 - Increased Rev+ Skeletron Hand velocity while Skeletron is charging (this allows them to keep up with him). - Done ✅ \n35 - Fixed various issues with Draeting Sim. - Done ✅ \n36 - Optimized universal tile merges. - Done ✅ \n37 - Reduced Rev+ Master Destroyer laser fire rate. - Done ✅ \n38 - Made Rev+ Plantera Thorn Ball projectiles more visible and made the spike projectiles they split into more visible. - Done ✅ \n39 - Made Rev+ Master Skeletron fire one skull while his hands are alive instead of two. - Done ✅ \n40 - Fixed Norfleet exploits in a very funny way :) - Done ✅",
